import React, { useState } from 'react';
import './App.css';

function App() {
  const [joke, setJoke] = useState('');
  const [showEmoji, setShowEmoji] = useState(false);

  const fetchJoke = async () => {
    try {
      setShowEmoji(true); // Show the emoji when fetching a new joke
      const response = await fetch('http://localhost:8080/get-joke');
      if (!response.ok) {
        throw new Error('Failed to fetch joke');
      }
      const data = await response.json();
      setJoke(data.joke);
    } catch (error) {
      console.error('Error fetching joke:', error);
    } finally {
      // Hide the emoji after some time (e.g., 2 seconds)
      setTimeout(() => setShowEmoji(false), 2000);
    }
  };

  return (
    <div className="App">
      <h1>Dad Joke Generator</h1>
      <div aria-live="assertive" ref={liveRegionRef}></div>
      <button onClick={fetchJoke}>Get a Joke</button>
      {joke && <p>{joke}</p>}
            <div>{showEmoji && <img className="emoji" alt="dad laughing" src="data:image/png;base64," />}</div>

    </div>
  );
}

export default App;
